 p_id=>wwv_flow_imp.id(3936818215740179)
,p_plug_name=>'DASHBOARD'
,p_region_template_options=>'#DEFAULT#:t-Region--scrollBody'
,p_plug_template=>4072358936313175081
,p_plug_display_sequence=>20
,p_query_type=>'SQL'
,p_plug_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'SELECT ''Total Transactions'' AS title,',
'       (SELECT COUNT(*)',
'          FROM habeeb_transactions t',
'          WHERE t.account_number IN (',
'              SELECT a.account_number',
'              FROM habeeb_accounts a',
'              JOIN habeeb_customers c ON a.customer_id = c.customer_id',
'              WHERE LOWER(c.email) = LOWER(:APP_USER)',
'          )) AS value',
'  FROM dual',
'UNION ALL',
'SELECT ''Total Deposits'',',
'       (SELECT COUNT(*)',
'          FROM habeeb_transactions t',
'          WHERE t.transaction_type = ''Deposit''',
'            AND t.account_number IN (',
'                SELECT a.account_number',
'                FROM habeeb_accounts a',
'                JOIN habeeb_customers c ON a.customer_id = c.customer_id',
'                WHERE LOWER(c.email) = LOWER(:APP_USER)',
'            ))',
'  FROM dual',
'UNION ALL',
'SELECT ''Total Withdrawals'',',
'       (SELECT COUNT(*)',
'          FROM habeeb_transactions t',
'          WHERE t.transaction_type = ''Withdrawal''',
'            AND t.account_number IN (',
'                SELECT a.account_number',
'                FROM habeeb_accounts a',
'                JOIN habeeb_customers c ON a.customer_id = c.customer_id',
'                WHERE LOWER(c.email) = LOWER(:APP_USER)',
'            ))',
'  FROM dual',
'UNION ALL',
'SELECT ''Total Transfers'',',
'       (SELECT COUNT(*)',
'          FROM habeeb_transactions t',
'          WHERE t.transaction_type = ''Transfer''',
'            AND t.account_number IN (',
'                SELECT a.account_number',
'                FROM habeeb_accounts a',
'                JOIN habeeb_customers c ON a.customer_id = c.customer_id',
'                WHERE LOWER(c.email) = LOWER(:APP_USER)',
'            ))',
'  FROM dual',
'UNION ALL',
'SELECT ''Sum of All Amounts'',',
'       (SELECT SUM(amount)',
'          FROM habeeb_transactions t',
'          WHERE t.account_number IN (',
'              SELECT a.account_number',
'              FROM habeeb_accounts a',
'              JOIN habeeb_customers c ON a.customer_id = c.customer_id',
'              WHERE LOWER(c.email) = LOWER(:APP_USER)',
'          ))',
'  FROM dual',
'UNION ALL',
'SELECT ''Total Deposit Amount'',',
'       (SELECT SUM(amount)',
'          FROM habeeb_transactions t',
'          WHERE t.transaction_type = ''Deposit''',
'            AND t.account_number IN (',
'                SELECT a.account_number',
'                FROM habeeb_accounts a',
'                JOIN habeeb_customers c ON a.customer_id = c.customer_id',
'                WHERE LOWER(c.email) = LOWER(:APP_USER)',
'            ))',
'  FROM dual',
'UNION ALL',
'SELECT ''Total Transfer Amount'',',
'       (SELECT SUM(amount)',
'          FROM habeeb_transactions t',
'          WHERE t.transaction_type = ''Transfer''',
'            AND t.account_number IN (',
'                SELECT a.account_number',
'                FROM habeeb_accounts a',
'                JOIN habeeb_customers c ON a.customer_id = c.customer_id',
'                WHERE LOWER(c.email) = LOWER(:APP_USER)',
'            ))',
'  FROM dual',
'UNION ALL',
'SELECT ''Total Withdraw Amount'',',
'       (SELECT SUM(amount)',
'          FROM habeeb_transactions t',
'          WHERE t.transaction_type = ''Withdrawal''',
'            AND t.account_number IN (',
'                SELECT a.account_number',
'                FROM habeeb_accounts a',
'                JOIN habeeb_customers c ON a.customer_id = c.customer_id',
'                WHERE LOWER(c.email) = LOWER(:APP_USER)',
'            ))',
'  FROM dual;',
''))
,p_query_order_by_type=>'ITEM'
,p_query_order_by=>'{ "itemName": "P2_ORDER_BY", "orderBys": [{"key":"TITLE","expr":"\"TITLE\" asc"},{"key":"VALUE","expr":"\"VALUE\" asc"}]}'
