'DECLARE',
'   v_stored_password VARCHAR2(255);',
'BEGIN',
'',
'   SELECT password',
'   INTO v_stored_password',
'   FROM habeeb_customers',
'  where lower(email) = lower(:app_user);',
'',
' ',
'   IF :P10_CURRENTPASSWORD != v_stored_password THEN',
'      APEX_ERROR.ADD_ERROR(',
'         p_message => ''Invalid Credentials.'',',
'         p_display_location => apex_error.c_inline_in_notification',
'      );',
'      RETURN;',
'   END IF;',
'',
'   ',
'   IF :P10_NEWPASSWORD != :P10_CONFIRMPASSWD THEN',
'      APEX_ERROR.ADD_ERROR(',
'         p_message => ''New password and Confirm password do not match.'',',
'         p_display_location => apex_error.c_inline_in_notification',
'      );',
'      RETURN;',
'   END IF;',
'',
'',
'   UPDATE habeeb_customers',
'   SET password = :p10_newpassword',
' where lower(email) = lower(:app_user);',
'',
'   APEX_UTIL.SET_SESSION_STATE(''P10_CURRENTPASSWORD'', NULL);',
'   APEX_UTIL.SET_SESSION_STATE(''P10_NEWPASSWORD'', NULL);',
'   APEX_UTIL.SET_SESSION_STATE(''P10_CONFIRMPASSWD'', NULL);',
'',
'',
'',
'END;'))
,p_process_clob_language=>'PLSQL'
,p_error_display_location=>'INLINE_IN_NOTIFICATION'
,p_internal_uid=>4435888495087243
);
