'create or replace TRIGGER trg_account_number',
'BEFORE INSERT ON habeeb_accounts',
'FOR EACH ROW',
'BEGIN',
'  IF :NEW.account_number IS NULL THEN',
'    :NEW.account_number := ''ACC'' || TO_CHAR(account_number_seq.NEXTVAL);',
'  END IF;',
'END;',
'/',
'create or replace PACKAGE BODY auth_pkg AS',
'',
'   -- Convert password to RAW and hash it using SHA512',
'   FUNCTION hash_password (',
'      p_password VARCHAR2',
'   ) RETURN VARCHAR2 IS',
'      l_raw   RAW(2000);',
'      l_hash  RAW(2000);',
'   BEGIN',
'      l_raw := UTL_I18N.STRING_TO_RAW(p_password, ''AL32UTF8'');',
'      l_hash := DBMS_CRYPTO.HASH(l_raw, DBMS_CRYPTO.HASH_SH512);',
'      RETURN RAWTOHEX(l_hash);',
'   END hash_password;',
'',
'   -- Authenticate user by comparing hash of entered password to stored hash',
'   FUNCTION authenticate_user (',
'      p_username VARCHAR2,',
'      p_password VARCHAR2',
'   ) RETURN BOOLEAN IS',
'      l_stored_hash VARCHAR2(255);',
'   BEGIN',
'      SELECT password_hash',
'        INTO l_stored_hash',
'        FROM app_users',
'       WHERE UPPER(username) = UPPER(p_username);',
'',
'      IF l_stored_hash = hash_password(p_password) THEN',
'         RETURN TRUE;',
'      END IF;',
'',
'      RETURN FALSE;',
'   EXCEPTION',
'      WHEN NO_DATA_FOUND THEN',
'         RETURN FALSE;',
'   END authenticate_user;',
'',
'   -- Get user role(s) by username',
'   FUNCTION get_user_roles (',
'      p_username VARCHAR2',
'   ) RETURN VARCHAR2 IS',
'      l_roles VARCHAR2(4000);',
'   BEGIN',
'      SELECT role',
'        INTO l_roles',
'        FROM app_users  ',
'       WHERE UPPER(username) = UPPER(p_username);',
'',
'      RETURN l_roles;',
'   EXCEPTION',
'      WHEN NO_DATA_FOUND THEN',
'         RETURN NULL;',
'   END get_user_roles;',
'',
'   -- Create new user and hash password before storing',
'   PROCEDURE create_user (',
'      p_email    app_users.email%TYPE,',
'      p_password app_users.password_hash%TYPE,',
'      p_username app_users.username%TYPE,',
'      p_role     app_users.role%TYPE',
'   ) AS',
'   BEGIN',
'      INSERT INTO app_users (',
'         email,',
'         password_hash,',
'         username,',
'         role',
'      ) VALUES (',
'         p_email,',
'         hash_password(p_password),',
'         p_username,',
'         p_role',
'      );',
'   END create_user;',
'',
'END auth_pkg;',
'/',
'create or replace PACKAGE BODY customer_auth AS',
'   FUNCTION authenticate_cust (',
'      p_email IN VARCHAR2,',
'      p_password IN VARCHAR2',
'   ) RETURN BOOLEAN AS',
'      v_count NUMBER := 0;',
'      v_custid NUMBER;',
'   BEGIN',
'       SELECT COUNT(*)',
'        INTO v_count',
'        FROM habeeb_customers',
'       WHERE LOWER(email) = LOWER(p_email) AND password = p_password;',
'',
'',
'      IF v_count = 1 THEN',
'         UPDATE habeeb_customers',
'            SET last_login = SYSDATE',
'          WHERE LOWER(email) = LOWER(p_email);',
'           SELECT customer_id',
'        INTO v_custid',
'        FROM habeeb_customers',
'       WHERE LOWER(email) = LOWER(p_email);',
'',
'',
'       INSERT INTO LOGIN_HISTORY (customer_id) VALUES(v_custid);',
'',
'         RETURN TRUE;',
'      ELSE',
'         RETURN FALSE;',
'      END IF;',
'   EXCEPTION',
'      WHEN OTHERS THEN',
'         ',
'         RETURN FALSE;',
'   END authenticate_cust;',
'END customer_auth;',
'/',
'create or replace package body customer_transfer_pkg as',
'   ',
'',
'   procedure transfer (',
'      p_from_account in varchar2,',
'      p_to_account   in varchar2,',
'      p_amount       in number',
'   ) is',
'      v_balance number;',
'      insuffbal exception;',
'   begin',
'',
'      select balance',
'        into v_balance',
'        from habeeb_accounts',
'       where account_number = p_from_account',
'      for update;',
'      if p_amount > v_balance then',
'         raise insuffbal;',
'      end if;',
'      if p_from_account = p_to_account then',
'         raise_application_error(',
'            -20006,',
'            ''Cannot transfer to same account''',
'         );',
'      end if;',
'      update habeeb_accounts',
'         set',
'         balance = balance - p_amount',
'       where account_number = p_from_account;',
'      update habeeb_accounts',
'         set',
'         balance = balance + p_amount',
'       where account_number = p_to_account;',
'               insert into ',
' habeeb_transfers_log(',
'   account_from,',
'   account_to,',
'   amount,',
'   remarks',
') values ( p_from_account,',
'           p_to_account,',
'           p_amount,',
'           ''Transfer from'' || p_from_account  ||''to'' ||p_to_account );',
'',
'      commit;',
'   exception',
'      when insuffbal then',
'         raise_application_error(',
'            -20001,',
'            ''insufficient balance''',
'         );',
'   ',
'   end transfer;',
'',
'',
'',
'end;',
'/',
'create or replace package body transaction_pkg as',
'   procedure deposit (',
'      p_account_number in varchar2,',
'      p_amount         in number,',
'       p_createdby    in number',
'   ) is',
'   begin',
'      update habeeb_accounts',
'         set',
'         balance = balance + p_amount',
'       where account_number = p_account_number;',
'        insert into habeeb_transactions (',
'   account_number,',
'   transaction_type,',
'   amount,',
'   remarks,',
'   created_by',
') values ( p_account_number,',
'           ''Deposit'',',
'           p_amount,',
'           ''Deposit into'' || p_account_number, p_createdby);',
'      commit;',
'   exception',
'      when others then',
'         rollback;',
'   end deposit;',
'',
'',
'   procedure withdraw (',
'      p_account_number in varchar2,',
'      p_amount         in number,',
'       p_createdby    in number',
'   ) is',
'      v_balance number;',
'      insuffbal exception;',
'   begin',
'      select balance',
'        into v_balance',
'        from habeeb_accounts',
'       where account_number = p_account_number',
'      for update;',
'',
'      if p_amount > v_balance then',
'         raise insuffbal;',
'      end if;',
'      update habeeb_accounts',
'         set',
'         balance = balance - p_amount',
'       where account_number = p_account_number;',
'        insert into habeeb_transactions (',
'   account_number,',
'   transaction_type,',
'   amount,',
'   remarks,',
'   created_by',
') values ( p_account_number,',
'           ''Withdrawal'',',
'           p_amount,',
'           ''Withdrawal from'' || p_account_number, p_createdby );',
'      commit;',
'   exception',
'      when insuffbal then',
'         raise_application_error(',
'            -20001,',
'            ''insufficient balance''',
'         );',
'      when others then',
'         rollback;',
'   end withdraw;',
'',
'   procedure transfer (',
'      p_from_account in varchar2,',
'      p_to_account   in varchar2,',
'      p_amount       in number,',
'       p_createdby    in number',
'   ) is',
'      v_balance number;',
'      insuffbal exception;',
'   begin',
'',
'      select balance',
'        into v_balance',
'        from habeeb_accounts',
'       where account_number = p_from_account',
'      for update;',
'      if p_amount > v_balance then',
'         raise insuffbal;',
'      end if;',
'      if p_from_account = p_to_account then',
'         raise_application_error(',
'            -20006,',
'            ''Cannot transfer to same account''',
'         );',
'      end if;',
'      update habeeb_accounts',
'         set',
'         balance = balance - p_amount',
'       where account_number = p_from_account;',
'      update habeeb_accounts',
'         set',
'         balance = balance + p_amount',
'       where account_number = p_to_account;',
'               insert into habeeb_transactions (',
'   account_number,',
'   transaction_type,',
'   amount,',
'   remarks,',
'   created_by',
') values ( p_from_account,',
'           ''Transfer'',',
'           p_amount,',
'           ''Transfer from'' || p_from_account  ||''to'' ||p_to_account, p_createdby );',
'',
'      commit;',
'   exception',
'      when insuffbal then',
'         raise_application_error(',
'            -20001,',
'            ''insufficient balance''',
'         );',
'      when others then',
'      raise;',
'     ',
'   end transfer;',
'',
'',
'',
'end;',
